import React from 'react';
import './FilmsList.css';

const FilmsList = ({ id, title, poster, year, genre }) => {
    return (
        <section className="film-container" key={id}>
            <img className="poster" src={poster} alt="Poster" />
            <div className="title"><h6></h6></div>
            <div className="info"><span className='info-year'>{year}, </span>{genre.join(', ')}</div>
        </section>
    );
};

export default FilmsList;
